import "./BackToTop.css";

function BackToTop() {
return (
        <button className="button" onClick={() => window.scrollTo({ top: 0, behavior: 'smooth' })}>
  <svg className="svgIcon" viewBox="0 0 20 20">
    <path d="M10 2 L2 10 H6 V18 H14 V10 H18 Z" />
  </svg>
</button>
    );
}

export default BackToTop;
